import React from 'react'



export default function Manu() {


  return (
    <div>
        <button className='roomBtn'>All-Tasks</button>
        <button>My-Task</button>
        <button>New-Task</button>
        <button>History</button>
        <button>Exite</button>
    </div>
  )
}
